import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
// import * from "react-bootstrap";
import "./headers.css"
import {Button, Container, Form, FormControl, Image, Nav, Navbar, NavDropdown} from "react-bootstrap";

class Header extends Component {
    constructor(props) {
        super(props);
        this.state = {
            logged_in: props.logged_in
        };
    }

    render() {
        let header;
        if (!this.state.logged_in) {
            header = (
                // <Button variant={"primary"} onClick={()=>this.props.onReq("about")}>Fuck</Button>
                <Navbar bg="dark" variant="dark" expand="lg" sticky={"top"}>
                    <Navbar.Brand onSelect={()=>this.props.onReq("home")}>WinDrop</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">
                            <Nav.Link onSelect={()=>this.props.onReq("home")}>Home</Nav.Link>
                            <Nav.Link onSelect={()=>this.props.onReq("faq")}>FAQs</Nav.Link>
                            <Nav.Link onSelect={()=>this.props.onReq("about")}>About</Nav.Link>
                            {/*<NavDropdown title="Dropdown" id="basic-nav-dropdown">*/}
                            {/*    <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>*/}
                            {/*    <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>*/}
                            {/*    <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>*/}
                            {/*    <NavDropdown.Divider />*/}
                            {/*    <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>*/}
                            {/*</NavDropdown>*/}
                        </Nav>
                        <Nav className="justify-content-end">
                            <Button variant={"outline-primary"} onClick={()=>this.props.onReq("about")}>Login</Button>
                            <Button variant={"primary"} href={"#"}>Sign-up</Button>
                        </Nav>
                    </Navbar.Collapse>
                </Navbar>
            );
        }
        else{
            header = (
                <Navbar bg="dark" variant="dark" expand="lg" sticky={"top"}>
                    <Container fluid={true}>
                        <Navbar.Brand onSelect={()=>this.props.onReq("home")}>WinDrop</Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="mr-auto">
                                <Nav.Link onSelect={()=>this.props.onReq("home")}>Home</Nav.Link>
                                <Nav.Link onSelect={()=>this.props.onReq("faq")}>FAQs</Nav.Link>
                                <Nav.Link onSelect={()=>this.props.onReq("about")}>About</Nav.Link>
                                {/*<NavDropdown title="Dropdown" id="basic-nav-dropdown">*/}
                                {/*    <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>*/}
                                {/*    <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>*/}
                                {/*    <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>*/}
                                {/*    <NavDropdown.Divider />*/}
                                {/*    <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>*/}
                                {/*</NavDropdown>*/}
                            </Nav>
                            <Nav className={"justify-content-end"}>
                                <NavDropdown eventKey={1} id="basic-nav-dropdown" drop={"left"}
                                title={
                                    <Image dir={"public/logo192.png"} alt={"user pic"}/>
                                }>

                                    <NavDropdown.Item eventKey={1.1} href="#profile">Profile</NavDropdown.Item>
                                    <NavDropdown.Item eventKey={1.2}>
                                        <i className="fa fa-sign-out"></i> Logout
                                    </NavDropdown.Item>
                                </NavDropdown>
                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
            );
        }
        return (
            header
        );
    }
}

export { Header };
